export default function LibrariesScreen({ navigation }) {
    return (
        <ImageBackground
            source={require('path/to/your/image.jpg')} // Update the path to your image
            style={styles.backgroundImage}
        >
            <View style={styles.container}>
                <View style={styles.buttonContainer}>
                    <TouchableOpacity style={styles.button} onPress={() => handleCreatedButtonPress()}>
                        <Text style={styles.buttonText}>Created</Text>
                    </TouchableOpacity>

                    <TouchableOpacity style={styles.button} onPress={() => handleFavoriteButtonPress()}>
                        <Text style={styles.buttonText}>Favorite</Text>
                    </TouchableOpacity>
                </View>
            </View>
        </ImageBackground>
    );
}
const styles = StyleSheet.create({
    container: {
        flexGrow: 1,
        alignItems: 'center',
        justifyContent: 'flex-start',
        paddingTop: 40,
    },
    buttonContainer: {
        flexDirection: 'row',
        marginTop: 10,
    },
    button: {
        backgroundColor: '#2978A0',
        paddingVertical: 15,
        paddingHorizontal: 30,
        borderRadius: 5,
        marginHorizontal: 10,
    },
    buttonText: {
        color: '#fff',
        fontSize: 18,
        fontWeight: 'bold',
    },
    backgroundImage: {
        flex: 1,
        resizeMode: 'cover', // or 'stretch'
        width: '100%',
        height: '100%',
    },
});
